import logo from "./logo.svg";
import "./App.css";
import Home from "./Home";

import { Navbar, Nav, Container } from "react-bootstrap";
import "bootstrap/dist/css/bootstrap.min.css";

import "./Style.css";
import Service from "./Service";

export default function App() {
  return (
    <div>
      <Container>
        <Navbar fluid className="Navbar">
          <Nav className="Menu" variant="pills" defaultActiveKey="/home">
            <Nav.Item>
              <Nav.Link className="Links mx-5 active-tabs" href="#home">
                Home
              </Nav.Link>
            </Nav.Item>
            <Nav.Item>
              <Nav.Link className="Links mx-5 tabs" eventKey="#service">
                Service
              </Nav.Link>
            </Nav.Item>
          </Nav>
        </Navbar>

        <div className="active-content">
          <Home />
        </div>

        <div className="content">
          <Service />
        </div>
      </Container>
    </div>
  );
}
